import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const Footer = () => {
  return (
    <footer className="bg-dark text-white text-center py-2 w-100" style={{position: "relative", bottom: 0}}>
        <p className="mb-0">&copy; 2025 AngelJMavare. Todos los derechos reservados.</p>
    </footer>
  );
};

export default Footer;
